import React from 'react';

export default class Userpage extends React.Component{


    render(){
        return(
            <>
                <div className="left-container">
                    <div id="p1">a</div>
                    <div id="p2">b</div>
                    <div id="p3">c</div>
                </div>
                <div className="right-container"></div>
            </>
        )
    }
}
